func minimumChanges(s string, k int) int {
    n := len(s)
    dp := make([][]int, n+1)
    for i := range dp {
        dp[i] = make([]int, k+1)
        for j := range dp[i] {
            dp[i][j] = 1<<31 - 1
        }
    }
    dp[0][0] = 0

    cost := func(i, j int) int {
        count := make([]int, 26)
        maxFreq, changes := 0, 0
        for l := i; l <= j; l++ {
            count[s[l]-'a']++
            maxFreq = max(maxFreq, count[s[l]-'a'])
        }
        for _, c := range count {
            changes += c
        }
        return changes - maxFreq
    }

    for i := 1; i <= n; i++ {
        for j := 1; j <= min(i, k); j++ {
            for l := j - 1; l < i; l++ {
                dp[i][j] = min(dp[i][j], dp[l][j-1]+cost(l, i-1))
            }
        }
    }

    return dp[n][k]
}

func min(a, b int) int {
    if a < b {
        return a
    }
    return b
}

func max(a, b int) int {
    if a > b {
        return a
    }
    return b
}
